SUSHI & SASHIMI – NIVEAU 2
2º NIVEAU DE DÉVELOPPEMENT DES COMPÉTENCES INTERMÉDIAIRES
OBJECTIFS:
Améliorer les techniques de préparation étudiées au niveau 1, élargir la connaissance des types de coupes de poisson, y compris la préparation de coupes de feuille de bambou (SASA), matériau utilisé pour décorer les plats de sushi et de sashimi.
