PRÉ-REQUIS:
Certificat de niveau 1 ou 1 an d’expérience au niveau professionnel ou scolaire (tout domaine lié à la cuisine)
MATÉRIEL / KIT DE FORMATION:
- Manuel du cours (INCLUS);
- Uniforme complet;
- Ensemble de couteaux japonais (1 Deba et 1 Yanagiba);
- Neta Box;
- Makisu Hasegawa;
- Manaïta Hasegawa;
